<script>
    $(function () {
        var changeSize = function () {
            const percentW = document.documentElement.clientWidth / 1920
            const percentH = document.documentElement.clientHeight / 1080
            $('#main-box')[0].style.transform = 'scale(' + percentW + ',' + percentH + ')'
        }

        window.addEventListener('resize', changeSize)

        changeSize()
        var MyMarhq, MyMarhq1, MyMarhq2, MyMarhq3, MyMarhq4;
        //请求函数
        var baseUrl = '/dg-grain-api/view/report/'

        var _get = function (url, callback) { // 网络请求
            url = baseUrl + url
            let token = null;
            try {
                token = window.parent.sessionStorage.getItem('VUEX_ST_TOKEN')
            } catch (e) { }
            $.ajax({
                headers: {
                    'Authorization': token,
                    Source: 'PC',
                },
                url: url,
                type: 'GET',
                success: callback,
                dataType: 'json',
            });
        }
        //单位换算
        function unit(sum) {
            if (sum) {
                return Math.round(Number(sum) / 100) / 100
            } else {
                return 0
            }
        }
        //单位换算
        function unitTwo(sum) {
            if (sum) {
                if (Number(sum) > 100000000) {
                    return Math.round(Number(sum) / 1000000) / 100 + '亿'
                } else if (Number(sum) > 10000) {
                    return Math.round(Number(sum) / 100) / 100 + '万'
                } else {
                    return Math.round(Number(sum) * 100) / 100
                }
            } else {
                return "0"
            }
        }
        //根据数据大小判断是否需要改变数字大小
        function fontSizeConversion(sum) {
            let str = String(sum);
            let font = 40;
            switch (str.length) {
                case 6: {
                    font = 36;
                    break;
                }
                case 7: {
                    font = 32;
                    break;
                }
                case 8: {
                    font = 28;
                    break;
                }
            }
            return font + 'px'
        }

            var convertData = function (data) {
                var res = [];
                for (let i = 0; i < data.length; i++) {
                    //判断是否有经纬度
                    if (data[i].location) {
                        //判断地址是否再河南
                        let district = false
                        for (let j = 0; j < henanList.length; j++) {
                            if (data[i].district.includes(henanList[j])) {
                                district = true;
                                break;
                            }
                        }
                        if (district) {
                            let location = data[i].location.split(',')
                            res.push({
                                name: data[i].pointName,
                                value: location,//经纬度
                                content: {
                                    name: data[i].pointName,
                                    site: data[i].district,
                                    sum: data[i].houseCount,
                                    capacity: data[i].totalVolume,
                                    currentWheatCapacity: data[i].currentWheatCapacity,
                                    currentCornCapacity: data[i].currentCornCapacity,
                                    typeBucket: data[i].typeBucket,
                                    img: data[i].tagUrl
                                }
                            });
                        }
                    }
                }
                return res;
            };

                        type: "scatter",
                        coordinateSystem: "geo",
                        label: {
                            formatter: "{b}",
                            position: "bottom",
                            fontSize: 14,
                            lineHeight: 20,
                            fontFamily: "PingFangSC-Medium, PingFang SC",
                            color: "#8BFBFF",
                            show: false,
                        },
                        data: mapData,
                        symbol: (params) => {
                            if (params[3] == 1) {
                                return smMapTip1
                            } else {
                                return smMapTip2
                            }
                        },
                        symbolSize: (params) => {
                            if (params[3] == 1) {
                                return [75, 75]
                            } else {
                                return [19, 17]
                            }
                        },
                        itemStyle: {
                            opacity: 1
                        },
                        emphasis: {
                            scale: 5
                        },
                        z: 10
                    }
                ],
            };
            var mapDiv = echarts.init(map);
            mapDiv.setOption(option);
            // 鼠标划入
            mapDiv.on('mouseover', (params) => {
                clearInterval(MyMarhq);
                mapDiv.dispatchAction({
                    type: 'showTip',
                    seriesIndex: 1,
                    dataIndex: params.dataIndex
                });
                let newMapData = mapData.map(item => {
                    if (item.name == params.name) {
                        item.value[3] = 1
                    } else {
                        item.value[3] = 0
                    }
                    return item
                })
                option.series[1].data = newMapData
                mapDiv.setOption(option, true)
                mapDiv.dispatchAction({
                    type: 'showTip',
                    seriesIndex: 1,
                    dataIndex: params.dataIndex
                });
            });
            //鼠标划出
            mapDiv.on('mouseout', (params) => {
                let newMapData = mapData.map(item => {
                    item.value[3] = 0
                    return item
                })
                option.series[1].data = newMapData
                mapDiv.setOption(option, true);
                MyMarhqFunc()
            });

            let mapDivDataIndex = 0;
            //定时Tip
            MyMarhqFunc();
            function MyMarhqFunc() {
                clearInterval(MyMarhq);
                MyMarhq = setInterval(function () {
                    if (mapDivDataIndex == mapData.length) {
                        mapDivDataIndex = 0;
                    }
                    let newMapData = mapData.map((item, index) => {
                        if (mapDivDataIndex == index) {
                            item.value[3] = 1
                        } else {
                            item.value[3] = 0
                        }
                        return item
                    })
                    option.series[1].data = newMapData;
                    mapDiv.setOption(option, true)
                    mapDiv.dispatchAction({
                        type: 'showTip',
                        dataIndex: mapDivDataIndex,
                        seriesIndex: 1,
                    })
                    mapDivDataIndex++
                }, 5000)
            }
        }
        //渲染地图 --end

        //不同粮食品种 --start
        let typeStatus = $('#typeStatus')[0];
        let typeColorList = [];

                normal: {
                    color: item + "1)",
                    lineStyle: {
                        color: item + "1)",
                        width: 1,
                    },
                    areaStyle: {
                        color: new echarts.graphic.LinearGradient(0, 1, 0, 0, [
                            {
                                offset: 0,
                                color: item + "0)",
                            },
                            {
                                offset: 1,
                                color: item + "0.9)",
                            },
                        ]),
                    },
                },
            })
        })

            if (res.success) {
                typeDetail=res.data.typeDetail
                typeData = res.data.changeVoList.reverse();
                //渲染图表
                CapacityChangeEcharts();
            }
        });
        function CapacityChangeEcharts() {
            if (!typeData.length) return
            let series=[];
            if(typeDetail.length>6){
                typeDetail.splice(6)
            }
            typeDetail.map((item, index) => {
                series.push(
                    {
                        name: item,
                        type: "line",
                        symbolSize: 0,
                        itemStyle: typeColorList[index],
                        data: typeData.map(items => {
                            return items.typeBucket[item] || 0
                        }),
                    },)
            })
            var typeOption = {
                grid: {
                    left: "2%",
                    right: "8%",
                    top: "15%",
                    bottom: "2%",
                    containLabel: true,
                },
                legend: {
                    show: true,
                    x: "right",
                    top: "5%",
                    icon: "stack",
                    itemWidth: 10,
                    itemHeight: 10,
                    textStyle: {
                        color: "#E6F7FF",
                    },
                    data: typeDetail,
                },
                tooltip: {
                    trigger: 'axis',
                    backgroundColor: "rgba(0,0,0,0)",
                    borderColor: "rgba(0,0,0,0)",
                    padding: 0,
                    borderWidth: 0,
                    axisPointer: {
                        lineStyle: {
                            color: "rgba(217, 231, 255, 0.85)",
                            type: "solid"
                        }
                    },
                    extraCssText: 'box-shadow: 0 0 0px rgba(0, 0, 0, 0);',
                    formatter: function (params) { // 鼠标移入展示百分比
                        let tip = "";
                        if (params != null && params.length > 0) {
                            tip += `<div class="type-tooltip">`;
                            tip += params[0].name
                            for (var i = 0; i < params.length; i++) {
                                tip += `<div>${params[i].marker}${params[i].seriesName}:${params[i].value}吨</div>`
                            }
                            tip += '</div>'
                        }
                        return tip
                    },
                },
                xAxis: [
                    {
                        type: "category",
                        boundaryGap: false,
                        axisLabel: {
                            color: "rgba(217, 231, 255, 1)",
                            showMinLabel: true,
                            showMaxLabel: true,
                        },
                        axisTick: {
                            show: false,
                        },
                        axisLine: {
                            show: true,
                            lineStyle: {
                                color: "rgba(217, 231, 255, 0.85)",
                            },
                        },
                        data: typeData.map(item => {
                            return item.uploadDataTime
                        })
                    },
                ],
                yAxis: [
                    {
                        type: "value",
                        name: "单位（吨）",
                        nameTextStyle: {
                            color: "rgba(217, 231, 255, 0.85)",
                            align: "center",
                        },
                        axisTick: {
                            show: false,
                        },
                        axisLabel: {
                            formatter: "{value}",
                            textStyle: {
                                color: "rgba(217, 231, 255, 0.85)",

                        },
                        axisLine: {
                            show: false,
                        },
                        splitLine: {
                            show: false,
                        },
                    },
                ],
                series: series,
            };
            var typeDiv = echarts.init(typeStatus);
            typeDiv.setOption(typeOption);
            let typeStatusIndex = 0;
            typeDiv.dispatchAction({
                type: 'showTip',
                dataIndex: typeStatusIndex,
                seriesIndex: 0,
            })
            clearInterval(MyMarhq4);
            MyMarhq4 = setInterval(function () {
                typeStatusIndex++
                if (typeStatusIndex == typeData.length) {
                    typeStatusIndex = 0;
                }
                typeDiv.dispatchAction({
                    type: 'showTip',
                    dataIndex: typeStatusIndex,
                    seriesIndex: 0,
                })
            }, 3000)
        }

        let colorList = ['rgba(255, 184, 61,', 'rgba(0, 94, 206,', 'rgba(76, 127, 214,', 'rgba(93, 167, 255,', 'rgba(191, 215, 255,', 'rgba(106, 112, 124,'];
        function colorListFun(length) {
            let distributeColors = [];
            let newColor = colorList.slice(0, length).reverse();
            newColor.forEach((item, index) => {
                let i = 1
                if (index < 3) {
                    i = index / 3
                    i = i < 0.5 ? 0.5 : i
                }
                distributeColors.push(new echarts.graphic.LinearGradient(0, 1, 0, 0, [{
                    offset: 0,
                    color: item + "0.05)"
                }, {
                    offset: 1,
                    color: item + i + ")"
                }]))
            })
            return distributeColors
        }
        let capacityDistributeList = [];
        _get('capacityDistribute', function (res) {
            if (res.success) {
                capacityDistributeList = res.data;
                //渲染图表
                capacityDistributeEcharts();
            }

                    if (index < 5) {
                        distributeData.push({
                            name: item.district,
                            num: Number(item.typeBucket[name]),

                    } else {
                        otherSum += Number(item.typeBucket[name])
                        if (index == capacityDistributeListNew.length - 1) {

                        }

                }, {

                }]
                let distributeOption = {
                    title: {
                        right: "0%",
                        bottom: "0%",
                        text: `{a|}{b|${distributeList[keyIndex].name}}`,
                        textStyle: {
                            rich: {
                                a: {
                                    backgroundColor: {
                                        image: distributeList[keyIndex].img,
                                        size: "100%"
                                    },
                                    width: 24,
                                    height: 24
                                },
                                b: {
                                    color: '#F1F6FF',
                                    fontSize: '16px',
                                    fontWeight: 6000,
                                    padding: 10
                                }
                            }
                        }
                    },
                    color:colorListFun(capacityDistributeListNew.length),
                    series: [
                        {
                            type: 'funnel',
                            left: '5%',
                            top: "10%",
                            width: '50%',
                            height: "80%",
                            sort: 'none',
                            label: {
                                color: "#333",

                            },

                            },

                        {
                            type: 'funnel',
                            left: '5%',
                            top: "10%",
                            width: '50%',
                            height: "80%",
                            sort: 'none',
                            label: {
                                position: 'inside',
                                formatter: function (d) {

                                    var ins = Math.round(d.data.num / sum * 10000) / 100 + '%';
                                    return ins;
                                },
                                color: '#fff',
                                fontSize: 14,
                            },
                            itemStyle: {
                                borderWidth: 0,
                            },
                            data: distributeData,
                            z: 100

                    $(`#distribute${key}`).parent('.swiper-slide').css("display", "block")
